import React from "react";
import { NavLink } from "react-router-dom";

import "../CSS/matchSelector.css";
import { useNavigate } from "react-router-dom";

function RankTypeSelector(props) {
  return (
    <div>
      <br />
      <div className="row">
        <div className="col-1"></div>
        <div className="col-3" style={{ marginTop: "10px" }}>
          <NavLink to="/stats">
            <h6 className="tab">All</h6>
          </NavLink>
        </div>
        <div className="col-4" style={{ marginTop: "10px" }}>
          <NavLink to="/compare">
            <h6 className="tab">Compare</h6>
          </NavLink>
        </div>
        <div className="col-4" style={{ marginTop: "10px" }}>
          <NavLink to="/rank">
            <h6 className="tab">Rank</h6>
          </NavLink>
        </div>{" "}
        <div className="col-1"></div>
      </div>
    </div>
  );
}

export default RankTypeSelector;
